import React from "react";

function Resume() {
	return (
		<section>
			<div className="center">
				<h1 className="page-header">Resume</h1>
			</div>
			<div className="bottom-spacing">
				Please click <a href={require("../../assets/files/Owais' Resume.pdf")} download>
					<h4>here</h4>to download my resume.
				</a>
			</div>
		</section>
	);
}

export default Resume;
